  <style>
    * {
      box-sizing: border-box;
      font-size: 14px;
      font-size: 96.11% !important;
      line-height: 183.89% !important;
    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      overflow: hidden;
      background-color: #000;
      font-size: 18px;
      color: #fff;
      max-width: 600px;
      margin: 0 auto
    }

    img {
      width: 100%
    }

    header {
      background-color: #0e0e0e;
      border-bottom: 1px solid #151515;
      display: grid;
      grid-template-columns: 1fr 2fr 1fr;
      height: 60px;
      align-items: center;
      padding: 0 10px
    }

    .logo {
      font-size: large;
      text-align: center;
      letter-spacing: .5px
    }

    mark {
      background: #ff9000;
      padding: 1px 4px;
      border-radius: 4px
    }

    .h__controls {
      display: flex;
      justify-content: flex-end
    }

    main {
      padding: 1em 0;
      max-width: 100%;
      margin: 0 auto
    }

    picture {
      display: block;
      position: relative
    }

    picture:before {
      content: '';
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 60px;
      height: 60px;
      background-color: rgba(0, 0, 0, .6);
      border-radius: 50%;
      cursor: pointer;
      z-index: 2
    }
